import React,{useState} from 'react';
import styles from './style.module.scss';
import { MenuFoldOutlined, MenuUnfoldOutlined, UserOutlined, VideoCameraOutlined,} from '@ant-design/icons';
import { Layout, Menu } from 'antd';
const { Header, Sider, Content } = Layout;


export const HomeManagePage = () => {
    const [collapsed, setCollapsed] = useState(false);
    return (
        <Layout>
            <Sider trigger={null} collapsible collapsed={collapsed}>
                <div className="logo" />
                <Menu theme="dark" mode="inline" defaultSelectedKeys={['1']} >
                    <Menu.Item key='1' icon={UserOutlined}></Menu.Item>
                </Menu>
            </Sider>
            <Layout className="site-layout">
                <Header
                    className="site-layout-background"
                    style={{
                        padding: 0,
                    }}
                >
                    {collapsed ?
                        <MenuUnfoldOutlined className={styles.trigger} onClick={() => setCollapsed(!collapsed)}/>
                        : <MenuFoldOutlined className={styles.trigger} onClick={()=> setCollapsed(!collapsed)}/>
                    }
                </Header>
                <Content
                    className="site-layout-background"
                    style={{
                        margin: '24px 16px',
                        padding: 24,
                        minHeight: 1000,
                    }}
                >
                    Content
                </Content>
            </Layout>
        </Layout>
    );
};
